import React, { useEffect, useState } from 'react';

function Side_work() {
  const [count, setcount] = useState(0);

  useEffect(() => {
    console.log(`The count is: ${count}`);

    if (count === 5) {
      alert("Count reached 5!");
    }
  }, [count]);

  const changecount = () => {
    setcount(count + 1);
  };

  return (
    <>
      <h1 className="text-danger">{count}</h1>
      <button className="btn btn-warning" onClick={changecount}>
        Increase
      </button>
    </>
  );
}

export default Side_work;
